def register_lookup(id):
	''' Register lookup:
	    Return register decriptor (dictionary) for ID.
	    ID is an operand value from opcode tables or modr/m decoding.
	'''
	return ia32_registers[id]

# runtime cache of register objects
ia32_register_objects = [ None ] * 92

def register_factory(id):
	if ia32_register_objects[id]:
		return ia32_register_objects[id]

	descr = ia32_registers[id]
	alias = None
	if descr['alias_of']:
		alias = register_factory(descr['alias_of'])
	reg = ISA.Register(descr, alias, id)
	ia32_register_objects[id] = reg

	return reg
